using AzureBlob.Services;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Extensions.Configuration;

namespace AzureBlob.Controllers
{
    [ApiController]
    [Route("[controller]")]
    public class HomeController : ControllerBase
    {
        private readonly IConfiguration _configuration;

        public HomeController(IConfiguration configuration)
        {
            _configuration = configuration;
        }

        [HttpPost]
        public string Post([FromBody] UploadImageCommand command)
        {
            //exemplo de arquivo para uso
            //data:image/png;base64,

            var uploadService = new FileUpload();
            return uploadService.UploadBase64Image(command.Image, _configuration.GetSection("Azure:Storage:Container").Value, _configuration.GetSection("Azure:Storage:Connection").Value);
                
        }
    }

    public class UploadImageCommand
    {
        public string Image { get; set; }
    }
}
